import React from "react";
import { Label } from "../Label/Label";
import { ContainerAssessment } from "./components";

const RoleItem = ({ item }) => {
  console.log(item);

  return (
    <div
      style={{
        border: "1px solid black",
        display: "flex",
        padding: "10px",
        margin: "20px",
      }}
    >
      <div
        style={{ border: "1px solid red", width: "100px", marginRight: "30px" }}
      >
        Icon
      </div>
      <div style={{ width: "100%" }}>
        <div style={{ display: "flex", justifyContent: "space-between" }}>
          <Label>{item.nome}</Label>
          <div>Maps</div>
        </div>
        <Label>{item.categoria}</Label>
        <Label>{item.cidade}</Label>
        <Label>{`Possui espaço kids? ${item.kids}`}</Label>
        <ContainerAssessment>
          <Label>{item.nota}</Label>
          <Label>{item.valor}</Label>
        </ContainerAssessment>
      </div>
    </div>
  );
};

export default RoleItem;
